INSERT INTO `comentariosmkt` VALUES (1,'2019-08-30','Se actualizó el material de apoyo para la fuerza de venta y se mandó a imprenta para entregarlo en la sala de ventas posteriormente (ficha de fuerza de venta y dípticos). Imprenta está a espera del pago, nos dieron fecha de entrega el próximo 4 de septiembre para despachar el material a nuestras oficinas.','Juan Camacaro',66,'2019-08-30 14:08:44','2019-08-30 14:08:44'),(2,'2019-08-30','Se actualizó el material de apoyo para la fuerza de venta y se mandó a imprenta (ficha de fuerza de venta y dípticos). Imprenta está a espera del pago, nos dieron fecha de entrega el próximo 4 de septiembre para despachar el material a nuestras oficinas.','Juan Camacaro',65,'2019-08-30 14:09:19','2019-08-30 14:09:19'),(3,'2019-08-30','Estamos a espera de confirmación para la reunión inicial, Francisco Vega y yo hemos tomado contacto vía mail con Pamela Leiva, la contraparte de Marketing, para reunirnos la semana entrante.','Juan Camacaro',216,'2019-08-30 14:12:16','2019-08-30 14:12:16'),(4,'2019-08-29','Se realizó reunión de Marketing el día jueves 29/08 y estamos ok con Smart Isla Teja, para proceder seguiremos mostrando la información del proyecto en nuestras redes sociales.','Juan Camacaro',109,'2019-08-30 14:36:02','2019-08-30 14:36:02'),(5,'2019-08-30','Proyecto vendido en su totalidad. Se creó y se publicará en el blog nota de éxito aprobada por la contraparte.','Juan Camacaro',157,'2019-08-30 14:39:42','2019-08-30 14:39:42'),(6,'2019-08-30','Estamos ok en cuanto a marketing. Por solicitud de la contraparte de Inspira, realizamos impresión de 50 dípticos más para entregarselos. La imprenta está a espera del pago para entregarnos el material y posteriormente mandarlo a la Sala de Ventas.','Juan Camacaro',130,'2019-08-30 15:02:55','2019-08-30 15:02:55'),(7,'2019-08-30','Estamos ok en cuanto a marketing. Por solicitud de la contraparte de Inspira, realizamos impresión de 50 dípticos más para entregarselos. La imprenta está a espera del pago para entregarnos el material y posteriormente mandarlo a la Sala de Ventas.','Juan Camacaro',140,'2019-08-30 15:03:35','2019-08-30 15:03:35'),(8,'2019-08-30','Se cargó el proyecto en la página web con información referencial. Estamos a la espera de los renders finales  y la información real del proyecto para actualizar la web y crear el material que se va a imprimir.','Juan Camacaro',217,'2019-08-30 15:08:33','2019-08-30 15:08:33'),(9,'2019-08-30','Condominio Neyen aún no tiene renders ni información. Cuando lo desarrollen nos harán llegar el material para empezar con los trabajos de marketing.','Juan Camacaro',211,'2019-08-30 15:11:25','2019-08-30 15:11:25'),(10,'2019-08-30','Tengo entendido que este proyecto se cayó, no tengo información al respecto al área de marketing.','Juan Camacaro',88,'2019-08-30 15:12:46','2019-08-30 15:12:46'),(11,'2019-08-30','Se cargó proyecto en la web, y se realizó y entregó material de mkt.','Juan Camacaro',134,'2019-08-30 15:15:28','2019-08-30 15:15:28'),(12,'2019-08-30','Se cargó proyecto en la web, y se realizó y entregó material de mkt.','Juan Camacaro',135,'2019-08-30 15:15:49','2019-08-30 15:15:49'),(13,'2019-08-30','Se realizó material de marketing, estamos a la espera del visto bueno por parte de MALPO para mandar a imprenta, y posteriormente entregarlo en físico.','Juan Camacaro',212,'2019-08-30 15:17:04','2019-08-30 15:17:04'),(14,'2019-08-30','Se realizó material de marketing, estamos a la espera del visto bueno por parte de MALPO para mandar a imprenta, y posteriormente entregarlo en físico.','Juan Camacaro',213,'2019-08-30 15:17:26','2019-08-30 15:17:26'),(15,'2019-08-30','Se realizó material de marketing, estamos a la espera del visto bueno por parte de MALPO para mandar a imprenta, y posteriormente entregarlo en físico.','Juan Camacaro',214,'2019-08-30 15:17:46','2019-08-30 15:17:46'),(16,'2019-08-30','Se realizará material de marketing la semana entrante, para entregarlo posteriormente.','Juan Camacaro',215,'2019-08-30 15:18:22','2019-08-30 15:18:22'),(17,'2019-08-30','Se realizará material de marketing la semana entrante, para entregarlo posteriormente.','Juan Camacaro',218,'2019-08-30 15:18:41','2019-08-30 15:18:41'),(18,'2019-08-30','Desconozco si ya se tomó contacto o se realizó algún trabajo inicial de Marketing con este proyecto, consultaré con Operaciones para trabajar en esto en caso de que no.','Juan Camacaro',54,'2019-08-30 15:44:44','2019-08-30 15:44:44'),(19,'2019-08-28','Se realizó reunión inicial de Marketing el día 28/08. Estamos a la espera del material gráfico y la información del proyecto para iniciar con los trabajos de marketing conjunto.','Juan Camacaro',203,'2019-08-30 16:17:31','2019-08-30 16:17:31'),(20,'2019-08-30','Se realizó reunión inicial de Marketing el día viernes 23/08. Creamos material previo con información sacada de la web para entregarle a la fuerza de venta durante la capacitación que se hizo el 30/08 en LCD. Estamos a la espera del material gráfico en alta para realizar las gráficas finales de marketing.','Juan Camacaro',204,'2019-08-30 16:23:23','2019-08-30 16:23:23'),(21,'2019-08-30','Se realizó reunión inicial de Marketing el día viernes 23/08. Creamos material previo con información sacada de la web para entregarle a la fuerza de venta durante la capacitación que se hizo el 30/08 en LCD. Estamos a la espera del material gráfico en alta para realizar las gráficas finales de marketing.','Juan Camacaro',205,'2019-08-30 16:23:41','2019-08-30 16:23:41'),(22,'2019-08-30','Se realizó reunión inicial de Marketing el día viernes 23/08. Creamos material previo con información sacada de la web para entregarle a la fuerza de venta durante la capacitación que se hizo el 30/08 en LCD. Estamos a la espera del material gráfico en alta para realizar las gráficas finales de marketing.','Juan Camacaro',206,'2019-08-30 16:24:08','2019-08-30 16:24:08'),(23,'2019-08-30','Se realizó reunión inicial de Marketing el día viernes 23/08. Creamos material