INSERT INTO `visitasalaventas` VALUES (20,'2019-07-12','Se hace la visita con Francisco Vega y Pablo Urdaneta.Queda todo funcionando OK.\nSe habla con  encargadas Silvia y  Cecilia, informan que en esta etapa quedan +/- 25 casas.\nNo se tiene claro si habrá piloto,no tienen los permisos municipales.\nTv queda funcionando con pendrive.\nSe incorpora a los dispositivos un google mini,quedan las encargadas capacitadas para mostrar la aplicación.','Cecilia soto D',NULL,'2019-07-25 16:08:44','2019-07-25 16:08:44',12),(21,'2019-07-23','Se visita sala de ventas atiende Leonar Silva (942202322) \n_se cuenta con internet de inmobiliaria\n_se inaguró piloto hace 15 días...se podría cambiar los dispositivos de la sala de ventas al piloto...Leonar avisará cuando cambian la sala de ventas.\n_Se cambian pilas de smoke sensor, motion sensor y D/W\n_Quedan en la primer torre 10 Deptos por vender\n_Otras torres mas de !00 deptos.\n_Se recomienda si se cambian los dispositivos al piloto cambiar el single switch 2 por Dimmer.(Recomendacion de Samuel,técnico que acompaña en la visita)','Cecilia Soto D',NULL,'2019-07-25 16:52:55','2019-07-25 16:52:55',38),(23,'2019-07-23','_Se encuentra encargada de  proyecto Romina,pide se retire stand,no se esta ocupando y ocuparia mucho espacio,se podría cambiar por una publicidad mas pequeña para escritorio.(avise a Marketing se vea algo para cambio,hable con Juan Camacaro)\n_piloto NO cuenta con internet...solo sala de ventas cuenta con internet.\n_No se pudo dejar aplicacion ni en telefono ni ipad.(no tiene cargador)\n_Se retiran maquetas:HCL,Dimmer,D/w (falta el sensor pequeño) Motion sensor','Cecilia Soto D',NULL,'2019-07-25 17:24:08','2019-07-25 17:24:08',73),(31,'2019-07-23','_Se habla con Alejandra Abarca,encargada de proyecto.\n_Buena disposición  de parte de la vendedora,le gusta la domotica.\n_Primera visita,se le hace entrega de presente (regalo) de Tamed\n_Para Septiembre es posible que se tenga piloto habilitado.\n_sala de venta tiene internet VTR',NULL,NULL,'2019-07-25 20:34:07','2019-07-25 20:34:07',50),(39,'2019-07-23','_se realiza visita con tecnicos ,encargada de proyecto Paola Lambertini un tanto complicada ya que en cualquier momento llegarian unos clientes.\n_Sala de venta no cuenta con internet,tienen una band.\n_Por orden de Ruth Pilar, jefa de las encargadass  se desenchufo Hc (todo lo de Tamed) porque piensan que le consume su internet .\n_Sonos no queda funcionando por falta de internet.\n__Se trae a of cargador de Ipad,no esta funcionando.\n_NO SE ESTA MOSTRANDO LA DOMOTICA EN EL PROYECTO.\n_Piloto esta listo,pero no se ha inagurado.\n_Quedan 11 depas por vender.\n_Se retira un Blast bot porque un cliente rompió  enchufe.\n_Llevar pila para keyfob proxima visita.','Cecilia Soto D',NULL,'2019-07-26 14:41:37','2019-07-26 14:41:37',66),(40,'2019-08-13','Se capacita a jefa de vendedoras Patricia Quezada y a vendedora Mónica Yáñez.\nAmables pero a la defensiva con el tema de domotica.\nSe le deja dipticos con el plan del proyecto,se le explica que pueden mandar linhk de la página más diptico en sus cotizaciones .\nEste proyecto se está vendiendo en verde y los clientes son más bien gente mayor.\nSolo en el teléfono de Patricia está la aplicación ,Mónica no lo tiene.\nMónica habla de domotica,pero No le gusta,lo encuentra complicado.\nAl explicarles lo sencillo y fácil que es la aplicación y contarles como funcionan los dispositivos ...ambas cambian de actitud.\nSe les deja regalo de Tamed y folletos.\nQuedan agradecidas y confiadas que cualquier duda me pueden llamar.','Cecilia soto',NULL,'2019-08-14 14:19:04','2019-08-14 14:19:04',78),(44,'2019-08-13','En Septiembre estarían inaugurando piloto.\nSala de ventas tiene internet de Movistar\nPiloto podría No tener internet.','Cecilia Soto',NULL,'2019-08-14 14:22:20','2019-08-14 14:22:20',78),(45,'2019-08-22','Maria Soledad,encargada del proyecto informa que en Septiembre podrían tener piloto.\n-Atenderían  solo fines de semana y festivos en el piloto.\n-Quedan por vender 22 deptos.\n-Se revisan dispositivos,todo funcionando perfecto.\n-Se pudo ver a M Soledad mostrar y explicar muy bien la domótica con unos clientes....FELICITACIONES para ella.','Cecilia Soto D',NULL,'2019-08-23 17:27:31','2019-08-23 17:27:31',18),(46,NULL,NULL,NULL,NULL,'2019-08-23 17:27:31','2019-08-23 17:27:31',18),(47,'2019-08-22','Encargada de proyecto: Loreto León Cisternas 56 942817618\nSala de ventas tiene internet.\nTodo funcionando Ok.\nAun no se sabe para cuando tendrían piloto.\nAl momento de la visita llegan clientes y vendedora explico muy bien todo lo de domótica.','Cecilia Soto D',NULL,'2019-08-23 20:37:54','2019-08-23 20:37:54',81),(48,'2019-08-21','Maria Eugenia Rojas encargada de proyecto.\nExplico a vendedora con lo que dispositivos se entrega los deptos.\nEntrego REGALITO de Tamed.','Cecilia Soto D',NULL,'2019-08-23 20:45:18','2019-08-23 20:45:18',28),(49,'2019-08-23','Encargados de proyecto:Delvis Rondon y Marco Vásquez  56951496515\n_Queda pendiente configurar google mini \nLos otros dispositivos funcionando Ok.\n_A fines de año podrían tener piloto.\n_Vendedores se ven comprometidos con la domótica,se hace una capacitación.\n_Se le manda link de pagina al whatsapp para que se lo envíen a sus clientes.\n-Hay internet en sala de ventas.','Cecilia Soto D.',NULL,'2019-08-23 21:08:04','2019-08-23 21:08:04',82),(50,'2019-08-30','Se capacitó a 1 vendedor  y  1 encargada de proyecto en el local de LCD.\n-karen Schevermann y Manuel Pereira.\nSe les entregó carpeta con material de apoyo a la fuerza de ventas,ficha y \ndipticos.','Cecilia Soto D',NULL,'2019-08-30 18:23:36','2019-08-30 18:23:36',84),(51,'2019-08-30','Proyecto hasta el momento solo cuenta con sala de ventas.','Cecilia Soto D',NULL,'2019-08-30 18:26:20','2019-08-30 18:26:20',84),(52,'2019-08-30','Proyecto hasta el momento solo cuenta con sala de ventas.','Cecilia Soto D',NULL,'2019-08-30 18:26:23','2019-08-30 18:26:23',84),(53,'2019-08-30','Proyecto hasta el momento solo cuenta con sala de ventas.','Cecilia Soto D',NULL,'2019-08-30 18:26:25','2019-08-30 18:26:25',84),(54,'2019-08-21','Se realiza visita sin técnico,se puede ver que todo está funcionando ok.\nProyecto no tiene por el momento piloto.\nSala de ventas tiene internet.','Cecilia Soto D.',NULL,'2019-08-30 18:47:20','2019-08-30 18:47:20',48),(55,'2019-08-22','Se visita sala de ventas,vendedora dice no saber nada de Tamed.\nHay piloto sin domotica,es un proyecto terminado,quedan pocos deptos por vender.\nTienen piloto sin domotica.',NULL,NULL,'2019-08-30 20:36:54','2019-08-30 20:36:54',19),(56,'2019-09-05','-Encargada de proyecto: Daniela Riquelme, se le entrega dipticos.\n-Tiene claro la domotica inicial con que se entrega las casas del proyecto.\n-Al momento de la visita en el piloto no estaba el router (de inmobiliaria) por lo que NO habia internet,encargada dice que es habitual esta práctica ...llevan router a sala de ventas.\n-Se cambia bateria de Smoke Sensor.\n-Queda pendiente cambio de bateria de Motion Sensor y Door/Window.\nProyecto cuenta con internet.','Cecilia Soto -Andres Padron',NULL,'2019-09-09 16:13:45','2019-09-09 16:13:45',92),(57,'2019-09-05','-Encargada de proyecto atiende muy rapido,se disculpa diciendo que tiene que mandar informacion a un cliente. (Elizabeth Caut. telefono fijo 32-24921544)\n-Piloto NO esta con domotica para mostrar.\n-Quedan 3 deptos por vender.\n-Se le manda link de pagina de TAMED y video de Danalock al celular de encargada.','Cecilia Soto D - Andrés Padron',NULL,'2019-09-09 16:25:49','2019-09-09 16:25:49',14),(58,NULL,NULL,NULL,NULL,'2019-09-09 16:25:49','2019-09-09 16:25:49',14),(59,'2019-09-05','-Se habla con vendedora part time Jessica Torres,no estaba capacitada,tenia muchas dudas con respecto a domótica.\n-Queda pendiente el tema si el Relay que va en el plan inicial del proyecto controlará luces de entrada ....??????\n-Todo funcionando bien en piloto.\n-Tienen internet.','Cecilia Soto D. Andres Padron',NULL,'2019-09-09 17:11:17','2019-09-09 17:11:17',40),(60,'2019-09-27','Se realiza visita al proyecto, atiende Ximena (part time) informando que queda solo 1 depto por vender.\n\nNo se pudo ver  piloto.\n\nLunes 30 se esta tratando de hablar telefonicamente con Jaime (encargado de proyecto) sin ser posible hasta pasado medio dia.   (seguire llamando)','Cecilia Soto',NULL,'2019-09-30 15:47:45','2019-09-30 15:47:45',94),(61,'2019-09-27','-Visita realizada con técnico Andrés Padrón.\n-Encrgadas de ventas Ilia Mora y Delvinor Rondon,tienen claro  plan inicial.\n-En Octubre 07 se cambia sala de ventas, quedaría en sala de eventos de proyecto.\n-Se tendrían que cambiar dispositivos.\n-Queda pendiente Cambio de batería de Smoke Sensor.','Cecilia Soto D.',NULL,'2019-09-30 16:38:44','2019-09-30 16:38:44',82),(62,'2019-09-27','-Se deja BAM TAMED.','Cecilia Soto D.',NULL,'2019-09-30 16:40:27','2019-09-30 16:40:27',82),(63,'2019-09-27','-Se deja BAM TAMED.','Cecilia Soto D.',NULL,'2019-09-30 16:40:31','2019-09-30 16:40:31',82),(64,'2019-09-27','-Se deja BAM TAMED.','Cecilia Soto D.',NULL,'2019-09-30 16:40:49','2019-09-30 16:40:49',82),(65,'2019-09-27','-Quedan 22 deptos por vender.\n-Piloto NO domotizado.\n-Todos los deptos van con domotica.\n-Se manda WhatsApp con link de página de TAMED al teléfono de proyecto.','Cecilia Soto D.',NULL,'2019-09-30 16:46:40','2019-09-30 16:46:40',36),(66,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:05','2019-09-30 16:52:05',94),(67,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:11','2019-09-30 16:52:11',94),(68,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:12','2019-09-30 16:52:12',94),(69,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:18','2019-09-30 16:52:18',94),(70,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:18','2019-09-30 16:52:18',94),(71,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:52:19','2019-09-30 16:52:19',94),(72,'2019-09-30','-Comunicacion telefónica con Jaime, solicita que TAMED se ponga en contacto con Carolina Paulinni para retiro de dispositivos de piloto.( Proyecto está terminado)','Cecilia Soto D.',NULL,'2019-09-30 16:53:37','2019-09-30 16:53:37',94);
