INSERT INTO `visitaspiloto` VALUES (1,'2019-07-23','_visita a piloto se hace con técnico Samuel Escola.\n_Queda todo funcionando ok.\n_Quedan 7 deptos por vender. \n_Se retiran dispositivos que estaban en antiguo piloto.\n_HCL  S/M   D/W   Router ( Dimmer y by pass quedaron en depto que era piloto,esta vendido y habitado.)','Cecilia Soto D',NULL,'2019-07-26 14:09:10','2019-07-26 14:09:10',110),(2,'2019-07-24','_Visita programada para este día,para ser capacitada la encargada de proyecto,pero no estaba informada que seria este día. _Estaba atendiendo a clientes y a la espera de otros,por lo que se realizo una capacitación muy rápida,le dejo link de pagina para que pueda ver y enviar a clientes.  _Aplicación esta funcionando. _MARIELA ARAYA. Encargada de proyecto.\n','Cecilia Soto D.',NULL,'2019-07-26 15:02:46','2019-07-26 15:02:46',66),(3,'2019-07-23','_Se capacita a encargada de proyecto Macarena Alvarez en los productos y como entrar y mostrar aplicación,también queda clara con el plan inicial de su proyecto.\n\n_ Se deja link de pagina de TAMED para que la envíe a clientes.\n\nPROYECTO SIN INTERNET.','Cecilia Soto D',NULL,'2019-07-26 15:25:32','2019-07-26 15:25:32',107),(4,'2019-08-06','Llamo Carlos Martínez,se encontraba la gerencia en el proyecto muy molestos por la NO instalación de cámaras que se ofrecieron en la última visita,tampoco se llevó iPad .\nCasi un mes sin respuesta.','Cecilia Soto D',NULL,'2019-08-06 16:11:17','2019-08-06 16:11:17',75),(5,'2019-07-26','No se encontró bypass correspondiente a luz de la cocina, por tanto se retira dimmer y se traslada a la oficina\nSmoke Sensor sin bateria','Andres Padrón',NULL,'2019-08-08 14:45:39','2019-08-08 14:45:39',40),(6,'2019-08-22','Se habla con Ximena Sepúlveda vendedora nueva en el proyecto,se le capacita sobre el plan inicial con que se entregan los deptos.,le gusta todo lo que sea domótica y entiende perfecto..vivió muchos años en Alemania.\n_Quedan 4 Deptos por vender.\n_Todos los dispositivos funcionando ok.\n_Samuel revisó aplicación.','Cecilia Soto D',NULL,'2019-08-23 17:14:08','2019-08-23 17:14:08',39),(7,'2019-08-22','Encargada de proyecto Nayarett Aguilera informa que la oficina en Vicuña Mackenna 6553 se arrendará en la semana del 26 de Agosto,por lo que se necesita en forma URGENTE retirar stand (mandare tb correo a Angree)\n-Piloto NO tiene internet \n-Quedan mas de 100 deptos por vender.\n-Los dispositivos están todos funcionando ok.','Cecilia Soto D',NULL,'2019-08-23 17:38:32','2019-08-23 17:38:32',48),(8,'2019-08-22','Natalia  Valenzuela encargada de proyecto informa  que en estos días se desarma piloto,solo queda 1 depto por vender.\n\nUrgente ....ver si se retiran los dispositivos.','Cecilia Soto D',NULL,'2019-08-23 20:30:38','2019-08-23 20:30:38',54),(9,'2019-09-05','Se intenta hablar en reiteradas ocaciones con encargada de proyecto Maria Eugenia, sin resultados.\n-Por favor comunicarse con contraparte para saber si se sigue visitando el proyecto.','Cecilia Soto D - Andrés Padron',NULL,'2019-09-09 16:31:59','2019-09-09 16:31:59',51),(10,'2019-09-05','-Encargada de proyecto : Eva Cuadra.\n-Piloto sin energia eléctrica al momento de la visita.\n-Quedan por vender 60 deptos  M/m\n-Piloto NO tiene internet.\n-Martes 10  llamaré a Ximena Galdames (jefa de ventas) para saber cuando se cambia piloto.\n-Sala de ventas tiene stand con maquetas.','Cecilia Soto D - Andrés Padron.',NULL,'2019-09-09 16:45:43','2019-09-09 16:45:43',53);
